import { useNavigate } from "react-router-dom";
import UserIcon from "../../icons/user";

function Topbar() {
  const navigate = useNavigate();
  const user = JSON.parse(sessionStorage.getItem("user")) || {};
  const position = {
    container: "flex justify-end px-5 py-2",
    wrapper: "flex gap-3",
  };
  const design = {
    container: "bg-gray-200",
    text: "text-xs font-medium cursor-pointer",
  };

  return (
    <div className={`${position.container} ${design.container}`}>
      {Object.keys(user).length ? (
        <div className={position.wrapper}>
          <p className={design.text} onClick={() => navigate("/register")}>
            Register
          </p>
          <p className={design.text}>|</p>
          <p className={design.text} onClick={() => navigate("/login")}>
            Login
          </p>
        </div>
      ) : (
        <div className={position.wrapper}>
          <UserIcon />
          <p>Hi, {user.name}</p>
        </div>
      )}
    </div>
  );
}

export default Topbar;
